import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function Home() {
  const [rotas, setRotas] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/api/rotas")
      .then((response) => setRotas(response.data))
      .catch((error) => console.error("Erro ao buscar rotas:", error));
  }, []);

  return (
    <div className="home">
      <h1>Bem-vindo ao RotaViagem</h1>
      <div className="rota-list">
        {rotas.map((rota) => (
          <div key={rota.id} className="rota-card">
            <h2>{rota.nome}</h2>
            <p>{rota.descricao}</p>
            <Link to={`/details/${rota.id}`}>Ver Detalhes</Link>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
